import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './About.css';
import Footer from './Footer';

const About = () => {
    const navigate = useNavigate();
    const [isServiceVisible, setIsServiceVisible] = useState(false);
    const [aboutData, setAboutData] = useState(null); // State to store GET data
    const [postData, setPostData] = useState({ name: '', message: '' }); // State for POST data

    const navigateTo = (path) => {
        navigate(path);
    };

    const toggleServices = () => {
        setIsServiceVisible((prevVisible) => !prevVisible);
    };

    // Fetch data on component mount
    useEffect(() => {
        fetch('/api/about') // Replace with your actual endpoint
            .then((response) => response.json())
            .then((data) => setAboutData(data))
            .catch((error) => console.error('Error fetching data:', error));
    }, []);

    // Handle POST request
    const handleSubmit = (e) => {
        e.preventDefault();
        fetch('/api/about', { // Replace with your actual endpoint
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify(postData),
        })
            .then((response) => response.json())
            .then((data) => {
                console.log('POST success:', data);
                alert('Data submitted successfully!');
                setPostData({ name: '', message: '' }); // Reset form
            })
            .catch((error) => console.error('Error submitting data:', error));
    };

    return (
        <div className="home-container">
            {/* Navbar */}
            <nav className="navbar">
                <h2>Event Plus</h2>
                <ul className="navbar-list">
                    <li onClick={() => navigateTo('/home')}>Home</li>
                    <li className="services-menu" onClick={toggleServices}>
                        Services
                        {isServiceVisible && (
                            <ul className="dropdown">
                                <li onClick={() => navigateTo('/WeddingDecor')}>Wedding Decors</li>
                                <li onClick={() => navigateTo('/NamingCeremony')}>Naming-ceremony</li>
                                <li onClick={() => navigateTo('/BirthdayParties')}>Birthday-parties</li>
                                <li onClick={() => navigateTo('/ProductLaunch')}>Product Launch</li>
                            </ul>
                        )}
                    </li>
                    <li onClick={() => navigateTo('/about')}>About Us</li>
                    <li onClick={() => navigateTo('/Contact')}>Contact Us</li>
                </ul>
            </nav>

            <div className="About-content">
                <h1 style={{ fontWeight: "bold", fontSize: "70px", textAlign: "center", marginBottom: "10px" }}>About.</h1>
                <div className="About-container">
                    {aboutData
                        ? <p>{aboutData.description}</p> // Display fetched data
                        : 'Loading...'}
                </div>
            </div>

            <div className="img">
                <img src="https://th.bing.com/th/id/OIP.UIqYmvMFMNILcPnwCl0AZAAAAA?rs=1&pid=ImgDetMain" style={{ width: "350px", height: "350px" }} alt="Decor" />
                <img src="https://cdn.cherishx.com/uploads/1690280041_large.jpg" style={{ width: "350px", height: "350px" }} alt="Decor" />
                <img src="https://i.pinimg.com/736x/a8/02/44/a802444d67d6289db6f954a3496fc612--naming-ceremony-party-at.jpg" style={{ width: "350px", height: "350px" }} alt="Ceremony" />
            </div>

            {/* POST Form */}
            <form onSubmit={handleSubmit} style={{ marginTop: "50px" }}>
                <h3>Submit Your Feedback</h3>
                <div>
                    <label>Name:</label>
                    <input
                        type="text"
                        value={postData.name}
                        onChange={(e) => setPostData({ ...postData, name: e.target.value })}
                        required
                    />
                </div>
                <div>
                    <label>Message:</label>
                    <textarea
                        value={postData.message}
                        onChange={(e) => setPostData({ ...postData, message: e.target.value })}
                        required
                    ></textarea>
                </div>
                <button type="submit">Submit</button>
            </form>

            {/* Footer section */}
            <Footer />
        </div>
    );
};

export default About;
